var handleThemeUpdate=e=>{var t=(e=e.data||e).default_theme;window.externalApp.externalBus(JSON.stringify({type:"frontend/get_themes",themes:e.themes})),"default"===t?window.externalApp.themesUpdated(JSON.stringify({name:t})):window.externalApp.themesUpdated(JSON.stringify({name:t,styles:e.themes[t]}))};window.hassConnection.then(({conn:e})=>{e.sendMessagePromise({type:"frontend/get_themes"}).then(handleThemeUpdate),e.subscribeEvents(handleThemeUpdate,"themes_updated")});